import React from 'react';
import styles from '../Main/Main.css';
function Main() {
  return (
    <div>
      <div className={styles.header}>
        <img src="" alt="" />
        <a href="login"></a>
      </div>
      <div className={styles.fblock}></div>
    </div>
  );
}

export default Main;
